import React from 'react'
import {IMenu} from '../../_interfaces/IMenu'
import {Grid, List, makeStyles} from '@material-ui/core'
import IngrdientListtem from './IngredientListItem'

const styles = makeStyles({
    container: {
        display: 'flex'
    },
    list:{
        display: 'flex',
        flexDirection: 'column'
    }
})

interface IProps{
    menu: IMenu
    isReadOnly: boolean
}


const IngrdientList: React.FC<IProps> = (props) => {

    const {menu, isReadOnly} = props
    const useStyle = styles()

    return(
       
        <List className={useStyle.list} >
            {menu?.ingredients?.length && menu?.ingredients?.map((ingredient, index) =>{
                return(
                    <IngrdientListtem key={index} ingredient={ingredient} isReadOnly={isReadOnly}/>
                )
            })}
            {!menu?.ingredients?.length && (
                    
                <IngrdientListtem key={0} ingredient={null} isReadOnly={isReadOnly}/>
                    
            )}
        </List>
        
    )
}

export default IngrdientList
